import React from "react";
import {
  Card,
  CardContent,
  CardMedia,
  CardHeader,
  Typography,
  withStyles,
  Button
} from "@material-ui/core";
import { orange } from "@material-ui/core/colors";

import discMania from "../../../images/discmania.png";

const styles = {
  card: {
    height: 250,
    width: 175,
    display: "relative"
  },
  media: {
    height: 90,
    width: 175,
    backgroundSize: "contain",
    backgroundRepeat: "no-repeat",
    opacity: 0.5,
    margin: "5px 0"
  },
  content: {
    height: 150,
    width: 175,
    padding: 0
  },
  header: {
    paddingTop: 5,
    paddingBottom: 5
  },
  title: {
    fontSize: "1em"
  },
  ratingsContainer: {
    display: "flex",
    justifyContent: "center",
    margin: "10px auto"
  },
  rating: {
    padding: "0 5px",
    borderTop: "1px solid grey",
    borderBottom: "1px solid grey",
    borderLeft: "1px solid grey",
    width: 35
  },
  rating4: {
    padding: "0 5px",
    borderTop: "1px solid grey",
    borderBottom: "1px solid grey",
    borderLeft: "1px solid grey",
    borderRight: "1px solid grey",
    width: 35
  }
};

export default withStyles(styles)(({ classes, data }) => {
  return (
    <Card raised className={classes.card}>
      <CardMedia
        title="DiscMania Logo"
        image={discMania}
        className={classes.media}
      />

      <CardContent className={classes.content}>
        <CardHeader
          title={data.discName}
          subheader="Distance Driver"
          className={classes.header}
          classes={{ title: classes.title }}
        />
        <div className={classes.ratingsContainer}>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating}>
            5
          </Typography>
          <Typography variant="h6" align="center" className={classes.rating4}>
            5
          </Typography>
        </div>
        <Button size="small" style={{ marginLeft: 10, color: orange[400] }}>
          Learn More
        </Button>
      </CardContent>
    </Card>
  );
});
